import React, { useContext } from 'react';
import ExperimentContext from '../context/experiment/experimentContext';


const OpenRun = ({ expidToken }) => {
    const experimentContext = useContext(ExperimentContext); 
    const { getExperimentRun, rundata } = experimentContext;
    const onSubmit = e => {
        e.preventDefault();
        getExperimentRun(expidToken);
    };

    const onAutoUpdate = e => {
        e.preventDefault();

    };

    return (
        <div className='card grid-1'>
        <form onSubmit={onSubmit} className='form'>
          <input
            type='submit'
            value='Show Running Data'
            className='btn btn-primary btn-block'
            // disabled={!enabledGraphSearch}
          />
        </form>
        { rundata &&  <form onSubmit={onAutoUpdate} className='form'>
          <input
            type='submit'
            value='Activate Auto Update'
            className='btn btn-success btn-block'
            // disabled={!enabledGraphSearch}
          />
        </form>}

      </div>
    )
}

export default OpenRun;
